// OntologyListItem.js
function OntologyListItem({ ontology, onSelect }) {

    const handleClick = () => {
        onSelect(ontology);
    }

    return (
        <div className='row' onClick={() => onSelect(ontology)}>
            {ontology}
        </div>
    );
}

export default OntologyListItem;
